import React, { useContext } from "react";
import { DarkModeContext } from "./DarkModeContext";
import { FaGithub, FaExternalLinkAlt, FaCode } from "react-icons/fa";

const Projects = () => {
  const { isDarkMode } = useContext(DarkModeContext);

  const projects = [
    {
      title: "Nexus AI: An AI Marketplace",
      description: (
        <>
          <p>
            - Developed and deployed Nexus AI, a secure web application enabling users to buy and sell AI models using cryptocurrency, 
            leveraging Firebase for user authentication and ensuring seamless transactions and data privacy.
          </p>
          <p>
            - Integrated blockchain technology for secure, transparent transactions and implemented Firebase for real-time user management, 
            optimizing performance and enhancing user experience within a decentralized marketplace.
          </p>
        </>
      ),
      githubLink: "https://github.com/Rohann-79/AI-Market-Place",
      demoLink: "https://ai-market-place-khaki.vercel.app/",
    },
    {
      title: "SipSense",
      description: "A wine recommendation system using machine learning to analyze user preferences and suggest wines based on taste profiles and ratings.",
      technologies: ["Python", "scikit-learn", "Flask", "React", "PostgreSQL"],
      github: "https://github.com/yourusername/sipsense",
      demo: "https://sipsense-demo.com",
      image: "https://images.unsplash.com/photo-1510812431401-41d2bd2722f3?w=800&auto=format&fit=crop&q=60&ixlib=rb-4.0.3"
    },
    {
      title: "Finance Tracker",
      description: "A comprehensive financial management application with expense tracking, budget planning, and investment portfolio analysis.",
      technologies: ["React", "Node.js", "Express", "MongoDB", "Chart.js"],
      github: "https://github.com/yourusername/finance-tracker",
      demo: "https://finance-tracker-demo.com",
      image: "https://images.unsplash.com/photo-1551288049-bebda4e38f71?w=800&auto=format&fit=crop&q=60&ixlib=rb-4.0.3"
    },
    {
      title: "CloudDeploy",
      description: "A cloud infrastructure management platform that simplifies deployment and scaling of applications across multiple cloud providers.",
      technologies: ["Python", "AWS", "Docker", "Kubernetes", "Terraform"],
      github: "https://github.com/yourusername/cloud-deploy",
      demo: "https://cloud-deploy-demo.com",
      image: "https://images.unsplash.com/photo-1544197150-b99a580bb7a8?w=800&auto=format&fit=crop&q=60&ixlib=rb-4.0.3"
    },
    {
      title: "DataViz",
      description: "An interactive data visualization platform that transforms complex datasets into beautiful, insightful visualizations with real-time updates.",
      technologies: ["React", "D3.js", "Python", "FastAPI", "PostgreSQL"],
      github: "https://github.com/yourusername/data-viz",
      demo: "https://data-viz-demo.com",
      image: "https://images.unsplash.com/photo-1551288049-bebda4e38f71?w=800&auto=format&fit=crop&q=60&ixlib=rb-4.0.3"
    }
  ];

  return (
    <section
      id="projects"
      className={`py-20 ${
        isDarkMode
          ? "bg-gradient-to-br from-[#0a0a1a] via-[#1a1a2e] to-[#0a0a1a]"
          : "bg-gradient-to-r from-blue-50 to-purple-50"
      }`}
    >
      <div className="container mx-auto px-4">
        <h2
          className={`text-4xl font-bold text-center mb-4 ${
            isDarkMode ? "text-white" : "text-gray-800"
          } code-text`}
          data-aos="fade-right"
        >
          Projects
        </h2>
        <p
          className={`text-center mb-12 ${
            isDarkMode ? "text-gray-400" : "text-gray-600"
          }`}
          data-aos="fade-up"
        >
          Some of my recent work
        </p>

        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8">
          {projects.map((project, index) => (
            <div
              key={index}
              className={`p-6 rounded-lg hover-card ${
                isDarkMode ? "bg-[#1a1a2e]/50" : "bg-white"
              } backdrop-blur-sm`}
              data-aos="fade-up"
              data-aos-delay={index * 200}
            >
              <div className="flex items-center justify-between mb-4">
                <h3
                  className={`text-2xl font-semibold ${
                    isDarkMode ? "text-white" : "text-gray-800"
                  } code-text`}
                >
                  {project.title}
                </h3>
                <FaCode className={`text-2xl ${
                  isDarkMode ? "text-purple-400" : "text-blue-600"
                }`} />
              </div>

              <div
                className={`mb-4 ${
                  isDarkMode ? "text-gray-300" : "text-gray-700"
                }`}
              >
                {project.description}
              </div>

              <div className="flex flex-wrap gap-2 mb-4">
                {project.technologies.map((tech, i) => (
                  <span
                    key={i}
                    className={`px-3 py-1 rounded-full text-sm ${
                      isDarkMode
                        ? "bg-[#2a2a3e] text-purple-400"
                        : "bg-blue-100 text-blue-600"
                    }`}
                  >
                    {tech}
                  </span>
                ))}
              </div>

              <div className="flex space-x-4">
                <a
                  href={project.github}
                  target="_blank"
                  rel="noopener noreferrer"
                  className={`flex items-center space-x-2 ${
                    isDarkMode
                      ? "text-purple-400 hover:text-purple-300"
                      : "text-blue-600 hover:text-blue-500"
                  }`}
                >
                  <FaGithub />
                  <span>Code</span>
                </a>
                {project.demo && (
                  <a
                    href={project.demo}
                    target="_blank"
                    rel="noopener noreferrer"
                    className={`flex items-center space-x-2 ${
                      isDarkMode
                        ? "text-purple-400 hover:text-purple-300"
                        : "text-blue-600 hover:text-blue-500"
                    }`}
                  >
                    <FaExternalLinkAlt />
                    <span>Live Demo</span>
                  </a>
                )}
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Projects;
